// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@chainlink/contracts/src/v0.6/interfaces/AggregatorV3Interface.sol";

import "./IPricingStrategy.sol";

contract FlatPricingStrategy is IPricingStrategy 
{
  using SafeMath for uint;

  /* BNB/USD price feed */
  AggregatorV3Interface internal priceFeed;

  constructor(address _priceFeed)
  {
    priceFeed = AggregatorV3Interface(_priceFeed);
  }


  function isPricingStrategy() override public pure returns (bool) {
    return true;
  }

  /** Self check if all references are correctly set.
   *
   * Checks that pricing strategy matches crowdsale parameters.
   */
  function isSane() override public pure returns (bool)
  {
    return true;
  }

  function currentUnitPrice(uint256 totalTokensSold) override public view returns (uint unitPrice, uint feedPrice)
  {
      (
        uint80 roundID, 
        int price,
        uint startedAt,
        uint timeStamp,
        uint80 answeredInRound
      ) = priceFeed.latestRoundData();

      // price is USD / BB with 8 digits
      // e.g. 67234124522 == 672.34124522 USD for 1 BNB
      feedPrice = uint(price);
      uint256 usdPrice = 0.025 * 10 ** 8;
      unitPrice = (usdPrice  * 10 ** 18) / feedPrice;

      return (unitPrice, feedPrice);
  }

  /**
   * When somebody tries to buy tokens for X eth, calculate how many tokens they get.
   *
   *
   * @param value - What is the value of the transaction send in as wei
   * @param tokensSold - how much tokens have been sold this far
   * @param weiRaised - how much money has been raised this far in the main token sale - this number excludes presale
   * @param msgSender - who is the investor of this transaction
   * @param decimals - how many decimal units the token has
   * @return tokenAmount - Amount of tokens the investor receives
   */
  function calculateTokenAmount(uint value, uint weiRaised, uint tokensSold, address msgSender, uint decimals) 
  override public view returns (uint tokenAmount)
  {
    uint multiplier = 10 ** decimals;
    (uint unitPrice, uint feedPrice) = currentUnitPrice(tokensSold);

    return value.mul(multiplier) / unitPrice;
  }
}

